    'introtext' => '',
    'content' => '<div>Приказ ФНС от 21 марта 2017 г. N ММВ-7-20/229@<br />В соответствии с абзацем двенадцатым пункта 4, абзацем шестым пункта 5 статьи 4.1 Федерального закона от 22 мая 2003 г. N 54-ФЗ "О применении контрольно-кассовой техники при осуществлении наличных денежных расчетов и (или) расчетов с использованием электронных средств платежа" приказываю:<br />1. Утвердить:<br />- дополнительные реквизиты фискальных документов согласно приложению N 1 к настоящему приказу.<br />- форматы фискальных документов, обязательных к использованию, согласно приложению N 2 к настоящему приказу.<br />2. Установить, что пункт 1 Таблицы 3 приложения N 2 к настоящему приказу утрачивает силу с 1 января 2019 года.<br />3. Руководителям (исполняющим обязанности руководителя) управлений Федеральной налоговой службы по субъектам Российской Федерации довести настоящий приказ до нижестоящих налоговых органов и обеспечить его применение.<br />4. Контроль за исполнением настоящего приказа возложить на заместителя руководителя Федеральной налоговой службы, координирующего вопросы методологического обеспечения и координации работы налоговых органов по осуществлению контроля и надзора за соблюдением требований к контрольно-кассовой технике, порядком и условиями ее регистрации и применения, полнотой учета выручки денежных средств в организациях и у индивидуальных предпринимателей, в том числе в части соблюдения порядка работы с денежной наличностью и порядка ведения кассовых операций, а также за соблюдением законодательства о национальной платежной системе в части компетенции налоговых органов.</div>',
